import '../others/rating.js'
import './home.css';
import ReviewMiniature from '../components/ReviewMiniature'
import '../others/rating.css'


const reviews = [
    {
        "Title": "This is the title",
        "Date": "29-09-2022",
        "Comments": 5,
        "Rating": 8,
    },{
        "Title": "This is the title",
        "Date": "29-09-2022",
        "Comments": 5,
        "Rating": 8,
    }
]

export default function Home(){
    return(
        <div className='home'>

            {
                reviews?.length > 0 
                ? (
                    <div className="container">
                        {reviews.map((review) => (
                            <ReviewMiniature review={review}/>
                        ))}
                    </div>
                ):(
                    <div className='empty'>
                        <h2>
                            No reviews found
                        </h2>
                    </div>
                )
            }
        </div>

    )
}
